import { Button, Icon, TextField } from '@material-ui/core';
import React, { Component } from 'react';

class AddProduct extends Component {
    render() {

        return (
            <>
                <form>
                    <label>Full Name</label>
                    <TextField
                        required id="standard-required" label="Required"
                    />
                    <label>SKU</label>
                    <TextField
                        required id="standard-required" label="Required"
                    />
                    <label>Price</label>
                    <TextField
                        required id="standard-required" label="Required"
                    />
                    <Button
                        type="submit"
                        variant="outlined"
                        color="secondary"
                        endIcon={<Icon>send</Icon>}
                    >Save Product</Button>
                </form>
            </>
        );
    }
}

export default AddProduct;
